import styled from 'styled-components';

const ProductsSidebarStyles = styled.div`
  display: grid;
  grid-column: 1;
  background-color: gray;
  width: vw;
  height: 100%;
`;

export default function ProductsSidebar() {
  return (
    <ProductsSidebarStyles>
      <div>Sidebar</div>
    </ProductsSidebarStyles>
  );
}
